export default function About() {
    return (
        <div>
            <h2>Mary Korch</h2>
            <p>Hello! I am 23 and grew up in Cedar Rapids, Iowa. I graduated from Creighton University in Omaha with an economics degree in 2018. While finishing up school, I was a College Pro Painters Franchisee before I left for the World Race. I love to workout, cook, and go on adventures. Through traveling, I love to explore how the truth of our Father manifests across other cultures. Additionally, I am passionate about bridging economics and faith to eradicate the poverty mindset.</p>
            <img></img>
            <h2>Catherine Gibson</h2>
        </div>
    );
}
